import React, { useState } from "react";
import Radio from "../../../components/radio/Radio";
import Nav from "../../../components/nav/Nav";
import Button from "../../../components/button/Button";


const Level=()=>{
    const [level,setLevel]=useState("bachelo");
    const handleChange=(e)=>{
        console.log("handleChanged");
        setLevel(e.target.value);
        console.log(level);
    }

    return(
        <div className="container-box">
            What is your highest level of education?
            <Radio id="highSchool" name="level" label="High School" value="highSchool" onChange={handleChange} checked={level==="highSchool"} />
            <Radio id="bachelors" name="level" label="Bachelors" value="bachelors" onChange={handleChange} checked={level==="bachelors"}/>
            <Radio id="masters" name="level" label="Masters" value="masters" onChange={handleChange} checked={level==="masters"}/>
            <Radio id="doctorate" name="level" label="doctorate" value="doctorate" onChange={handleChange} checked={level==="doctorate"}/>
            <Button className="signupBtn" label="Next"  />
            <Nav pageName="home"/>
        </div>
    )
}

export default Level;
